import { createSlice } from '@reduxjs/toolkit';
import salesData from '../../data/stackline_frontend_assessment_data_2021.json';

const initialState={
    data : salesData
};

const dataSlice= createSlice({
    name:'data',
    initialState:{
        sales: salesData,
    },
    reducers: {}
})

export default dataSlice.reducer;
